import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

const KeepData = (props) => {
    return (
        <>
        <div style = {{border: "2px solid"}}>
        <ol>
            {props.value.map((values , index) => {
                return (
                    <div className = "container">
                    <div className = "row">
                    <div className = "col-3">
                    <h4 className = "text-success text-capitalize text-justify" ><li>{values}</li></h4>
                    </div>
                    </div>
                    </div>
                )
            })}
            </ol>
            {props.value1.map((value , index) => {
                return (
                    <>
                    <div className = "container">
                    <div className = "row">
                    <div className = "col-3">
                    <p className = "text-warning text-capitalize text-justify " >{value}</p>
                    </div>
                    </div>
                    </div>
                    </>
                );
            })}
            </div>
        </>
    );
}
export default KeepData;
